INSERT INTO `core_email_template` VALUES
(1,27,'debtor-action-1','en','Outstanding invoices','Outstanding invoices','Hi,<br>\n<br>\nYou have one or more invoices that are overdue. Please review the attached statement.<br>\n<br>\nI would be really grateful if you could let me know when we can expect to receive payment.<br>\n<br>\nBest regards,<br>\n<br>\n{{business.name}}\n'),
(2,27,'debtor-action-1','nl','Openstaande facturen','Openstaande facturen','Geachte heer/mevrouw,<br>\n<br>\nU heeft n of meerdere openstaande facturen. U vindt ze in het bijgevoegde overzicht.<br>\n<br>\nIk zou het op prijs stellen wanneer u mij kunt laten weten wanneer we de betaling kunnen verwachten.<br>\n<br>\nMet vriendelijke groet,<br>\n<br>\n{{business.name}}<br>\n'),
(3,27,'debtor-action-2','en','Outstanding invoices (2nd reminder)','Outstanding invoices (2nd reminder)','Hi,<br>\n<br>\nYou have one or more invoices that are overdue. Please review the attached statement.<br>\n<br>\nThe open invoices are really problematic for us now so I urge you to pay the outstanding amount as soon as possible. Please\nlet us know when we can expect payment.<br>\n<br>\nBest regards,<br>\n<br>\n{{business.name}}<br>\n'),
(4,27,'debtor-action-2','nl','Openstaande facturen (2e herinnering)','Openstaande facturen (2e herinnering)','Geachte heer/mevrouw,<br>\n<br>\nU heeft n of meerdere openstaande facturen. U vindt ze in het bijgevoegde overzicht.<br>\n<br>\nDe betalingsachterstand is nu echt een probleem voor ons dus ik verzoek u dringend om de openstaande posten te betalen.\nLaat ons aub. weten wanneer dit gebeurd.<br>\n<br>\nMet vriendelijke groet,<br>\n<br>\n{{business.name}}<br>\n\n'),
(5,27,'fb-def-1','en','Quote','{{template.name}} {{document.number}}[if {{document.reference}}] - {{document.reference}}[/if]','[assign businessOrg = business.contactId | entity:Contact]\n[if {{contact.salutation}}]{{contact.salutation}}[else]Dear sir/madam[/if],\n<div><br></div>\n<div>Please find attached your quotation {{document.number}}[if {{document.reference}}] for {{document.reference}}[/if] as requested.</div>\n<div><br></div>\n<div>For questions we can be reached by email or on telephone number {{businessOrg.phoneNumbers | first | prop:number}}.&nbsp;</div>\n<div><br></div>\n<div>We look forward to working with you on this.&nbsp;</div>\n<div><br></div>\n<div>Best regards,&nbsp;</div>\n<div><br></div>\n<div><br></div>\n<div>{{creator.displayName}}</div>\n<div>{{creator.profile.jobTitle}}</div>\n<div>{{creator.profile.phoneNumbers | first | prop:number}}</div>\n<div>{{business.name}}</div>\n'),
(6,27,'fb-def-1','nl','Offerte','{{template.name}} {{document.number}}[if {{document.reference}}] - {{document.reference}}[/if]','<div>[assign businessOrg = business.contactId | entity:Contact]</div>\n<div>[if {{contact.salutation}}]{{contact.salutation}}[else]Geachte heer/mevrouw[/if],</div>\n<div><br></div>\n<div>Zoals afgesproken stuur ik je offerte {{document.number}}[if {{document.reference}}] voor\n    {{document.reference}}[/if] toe.\n</div>\n<div><br></div>\n<div>Voor vragen zijn wij bereikbaar per mail of op telefoon nummer {{businessOrg.phoneNumbers | first | prop:number}}.\n</div>\n<div><br></div>\n<div>Ik kijk er naar uit om met jullie samen hieraan te werken.</div>\n<div><br></div>\n<div>Met vriendelijke groet,</div>\n<div><br></div>\n<div><br></div>\n<div>{{creator.displayName}}</div>\n<div>{{creator.profile.jobTitle}}</div>\n<div>{{creator.profile.phoneNumbers | first | prop:number}}</div>\n<div>{{business.name}}</div>'),
(7,27,'fb-def-2','en','Order','{{template.name}} {{document.number}}[if {{document.reference}}] - {{document.reference}}[/if]','[if {{contact.salutation}}]{{contact.salutation}}[else]Dear sir/madam[/if],\n<div><br></div>\n<div>Hereby we send your order&nbsp;{{document.number}}[if {{document.reference}}] for {{document.reference}}[/if].\n    You can view the invoice and pay online by clicking this button:\n</div>\n<div><br></div>\n<div>\n    <a style=\"text-decoration: none; user-select none; -webkit-user-select: none; cursor: pointer; color: white; border-radius: 4px;display:inline-block; padding: 8px; background-color: #009bc9;\"\n       href=\"{{document.customerUrl}}\">{{document.number}}</a>\n</div>\n<div><br></div>\n<div>If you have any questions regarding this order don\'t hesitate to contact us.</div>\n<div><br></div>\n<div>Best regards,</div>\n<div><br></div>\n<div><br></div>\n<div>{{business.name}}</div>'),
(8,27,'fb-def-2','nl','Order','{{template.name}} {{document.number}}[if {{document.reference}}] - {{document.reference}}[/if]','[if {{contact.salutation}}]{{contact.salutation}}[else]Geachte heer/mevrouw[/if],\n<div><br></div>\n<div>Hereby we send your order&nbsp;{{document.number}}[if {{document.reference}}] for {{document.reference}}[/if].\n    You can view the invoice and pay online by clicking this button:\n</div>\n<div><br></div>\n<div>\n    <a style=\"text-decoration: none; user-select none; -webkit-user-select: none; cursor: pointer; color: white; border-radius: 4px;display:inline-block; padding: 8px; background-color: #009bc9;\"\n       href=\"{{document.customerUrl}}\">{{document.number}}</a>\n</div>\n<div><br></div>\n<div>If you have any questions regarding this order don\'t hesitate to contact us.</div>\n<div><br></div>\n<div>Best regards,</div>\n<div><br></div>\n<div><br></div>\n<div>{{business.name}}</div>'),
(9,27,'fb-def-3','en','Invoice','{{template.name}} {{document.number}}[if {{document.reference}}] - {{document.reference}}[/if]','[if {{contact.salutation}}]{{contact.salutation}}[else]Dear sir/madam[/if],\n<div><br></div>\n<div>Hereby we send your invoice&nbsp;{{document.number}}[if {{document.reference}}] for {{document.reference}}[/if].</div>\n<div><br></div>\n[if {{document.recurringPayment}}]\n[assign outstanding = {{document.totalPrice}} - {{document.paidAmount}}]\n[if {{outstanding}} == 0]\n<div>Your invoice was paid via direct debit.</div>\n[else]\n<div>We will charge you automatically via direct debit within the next few days.</div>\n[/if]\n    <div><br></div>\n    <div><br></div>\n[/if]\n\n<div>You can view the invoice and pay online by clicking this button:</div>\n\n<div><br></div>\n<div>\n    <a style=\"text-decoration: none; user-select none; -webkit-user-select: none; cursor: pointer; color: white; border-radius: 4px;display:inline-block; padding: 8px; background-color: #009bc9;\"\n       href=\"{{document.customerUrl}}\">{{document.number}}</a>\n</div>\n<div><br></div>\n<div>If you have any questions regarding this invoice don\'t hesitate to contact us.</div>\n<div><br></div>\n<div>Best regards,</div>\n<div><br></div>\n<div><br></div>\n<div>{{business.name}}</div>'),
(10,27,'fb-def-3','nl','Factuur','{{template.name}} {{document.number}}[if {{document.reference}}] - {{document.reference}}[/if]','[if {{contact.salutation}}]{{contact.salutation}}[else]Geachte heer/mevrouw[/if],\n<div><br></div>\n<div>Hierbij sturen wij u factuur&nbsp;{{document.number}}[if {{document.reference}}] voor {{document.reference}}[/if].</div>\n<div><br></div>\n[if {{document.recurringPayment}}]\n[assign outstanding = {{document.totalPrice}} - {{document.paidAmount}}]\n[if {{outstanding}} == 0]\n<div>Uw factuur is betaald via automatische incasso.</div>\n[else]\n<div>We gaan de komende dagen het bedrag automatisch afschrijven via automatische incasso.</div>\n[/if]\n<div><br></div>\n<div><br></div>\n[/if]\n\n<div> U kunt de factuur online bekijken en betalen via onderstaande knop:\n</div>\n<div><br></div>\n<div><a href=\"{{document.customerUrl}}\"\n        style=\"text-decoration: none; -webkit-user-select: none; cursor: pointer; color: white; border-radius: 4px; display: inline-block; padding: 8px; background-color: rgb(0, 155, 201);\">{{document.number}}</a>\n</div>\n<div><br></div>\n<div>Indien u vragen heeft over deze factuur neem dan contact met ons op.</div>\n<div><br></div>\n<div>Met vriendelijke groet,</div>\n<div><br></div>\n<div><br></div>\n<div>{{business.name}}</div>\n<div><br></div>\n'),
(11,27,'fb-def-4','en','Purchase order','{{template.name}} {{document.number}}[if {{document.reference}}] - {{document.reference}}[/if]','[if {{contact.salutation}}]{{contact.salutation}}[else]Dear sir/madam[/if],\n<div><br></div>\n<div>Hereby we send your order&nbsp;{{document.number}}[if {{document.reference}}] for {{document.reference}}[/if].\n    You can view the invoice and pay online by clicking this button:\n</div>\n<div><br></div>\n<div>\n    <a style=\"text-decoration: none; user-select none; -webkit-user-select: none; cursor: pointer; color: white; border-radius: 4px;display:inline-block; padding: 8px; background-color: #009bc9;\"\n       href=\"{{document.customerUrl}}\">{{document.number}}</a>\n</div>\n<div><br></div>\n<div>If you have any questions regarding this order don\'t hesitate to contact us.</div>\n<div><br></div>\n<div>Best regards,</div>\n<div><br></div>\n<div><br></div>\n<div>{{business.name}}</div>'),
(12,27,'fb-def-4','nl','Bestelling','{{template.name}} {{document.number}}[if {{document.reference}}] - {{document.reference}}[/if]','[if {{contact.salutation}}]{{contact.salutation}}[else]Geachte heer/mevrouw[/if],\n<div><br></div>\n<div>Hereby we send your order&nbsp;{{document.number}}[if {{document.reference}}] for {{document.reference}}[/if].\n    You can view the invoice and pay online by clicking this button:\n</div>\n<div><br></div>\n<div>\n    <a style=\"text-decoration: none; user-select none; -webkit-user-select: none; cursor: pointer; color: white; border-radius: 4px;display:inline-block; padding: 8px; background-color: #009bc9;\"\n       href=\"{{document.customerUrl}}\">{{document.number}}</a>\n</div>\n<div><br></div>\n<div>If you have any questions regarding this order don\'t hesitate to contact us.</div>\n<div><br></div>\n<div>Best regards,</div>\n<div><br></div>\n<div><br></div>\n<div>{{business.name}}</div>'),
(13,27,'fb-def-5','en','Purchase invoice','{{template.name}} {{document.number}}[if {{document.reference}}] - {{document.reference}}[/if]','[if {{contact.salutation}}]{{contact.salutation}}[else]Dear sir/madam[/if],\n<div><br></div>\n<div>Hereby we send your invoice&nbsp;{{document.number}}[if {{document.reference}}] for {{document.reference}}[/if].\n    You can view the invoice and pay online by clicking this button:\n</div>\n<div><br></div>\n<div>\n    <a style=\"text-decoration: none; user-select none; -webkit-user-select: none; cursor: pointer; color: white; border-radius: 4px;display:inline-block; padding: 8px; background-color: #009bc9;\"\n       href=\"{{document.customerUrl}}\">{{document.number}}</a>\n</div>\n<div><br></div>\n<div>If you have any questions regarding this invoice don\'t hesitate to contact us.</div>\n<div><br></div>\n<div>Best regards,</div>\n<div><br></div>\n<div><br></div>\n<div>{{business.name}}</div>'),
(14,27,'fb-def-5','nl','Inkoopfactuur','{{template.name}} {{document.number}}[if {{document.reference}}] - {{document.reference}}[/if]','[if {{contact.salutation}}]{{contact.salutation}}[else]Geachte heer/mevrouw[/if],\n<div><br></div>\n<div>Hereby we send your invoice&nbsp;{{document.number}}[if {{document.reference}}] for {{document.reference}}[/if].\n    You can view the invoice and pay online by clicking this button:\n</div>\n<div><br></div>\n<div>\n    <a style=\"text-decoration: none; user-select none; -webkit-user-select: none; cursor: pointer; color: white; border-radius: 4px;display:inline-block; padding: 8px; background-color: #009bc9;\"\n       href=\"{{document.customerUrl}}\">{{document.number}}</a>\n</div>\n<div><br></div>\n<div>If you have any questions regarding this invoice don\'t hesitate to contact us.</div>\n<div><br></div>\n<div>Best regards,</div>\n<div><br></div>\n<div><br></div>\n<div>{{business.name}}</div>'),
(15,28,'contract-book-1','en','Contract invoice (en)','Sales invoice {{invoice.number}}','[if {{contact.salutation}}]{{contact.salutation}}[else]Dear sir/madam[/if],\n<br>\n<br>\nYour invoice for {{contract.description}} for period {{invoice.date|date}} till\n{{contract.nextInvoiceDate|date}} is ready. <br />\n<br />\n[if {{document.recurringPayment}}]\n[assign outstanding = {{document.totalPrice}} - {{document.paidAmount}}]\n[if {{outstanding}} == 0]\nYour invoice was paid via direct debit.\n[else]\nWe will charge you automatically via direct debit within the next few days.\n[/if]\n<br /><br />\n[/if]\n\nClick the button below to view or pay the invoice:<br>\n<br>\n<a\n    href=\"{{invoice.customerUrl}}\"\n    style=\"text-decoration: none; user-select: none; -webkit-user-select: none; cursor: pointer; color: white; border-radius: 4px;display:inline-block; padding: 8px; background-color: #009bc9;\">{{invoice.number}}</a><br>\n<br>\nIf you have any questions about this invoice please contact us.<br>\n<br>\nBest regards,\n<br>\n<br>\n{{business.name}}<br>\n'),
(16,28,'contract-book-1','nl','Contract invoice (nl)','Factuur {{invoice.number}}','[if {{contact.salutation}}]{{contact.salutation}}[else]Geachte heer/mevrouw[/if],\n<br>\n<br>\nUw factuur voor {{contract.description}} voor periode {{invoice.date|date}} tot\n    {{contract.nextInvoiceDate|date}} is gereed. <br />\n<br />\n\n[if {{document.recurringPayment}}]\n[assign outstanding = {{document.totalPrice}} - {{document.paidAmount}}]\n[if {{outstanding}} == 0]\nUw factuur is betaald via automatische incasso.\n[else]\nWe gaan de komende dagen het bedrag automatisch afschrijven via automatische incasso.\n[/if]\n<br /><br />\n[/if]\n\nKlik op onderstaande knop om uw factuur te downloaden of te betalen:<br>\n<br>\n\n<a\n            href=\"{{invoice.customerUrl}}\"\n            style=\"text-decoration: none; user-select: none; -webkit-user-select: none; cursor: pointer; color: white; border-radius: 4px;display:inline-block; padding: 8px; background-color: #009bc9;\">{{invoice.number}}</a><br>\n<br>\nMet vriendelijke groet,<br>\n<br>\n{{business.name}}<br>'),
(17,29,NULL,'en','Standaard','Hi {{contact.firstName}}','Dear [if {{contact.prefixes}}]{{contact.prefixes}}[else][if !{{contact.gender}}]Ms./Mr.[else][if {{contact.gender}}==\"M\"]Mr.[else]Ms.[/if][/if][/if] {{contact.lastName}},<div><div><br></div><div><br></div><div>Best regards,</div><div><br></div><div>{{creator.displayName}}</div></div><div>{{creator.profile.organizations[0].name}}</div><div><br /></div><div><a href=\"{{unsubscribeUrl}}\">unsubscribe</a></div>'),
(18,32,'newmessage','en','newmessage','Re: {{ticket.title}}','{{comment.text}}<br /><br/><hr />This message was sent by {{commentCreator.displayName}} using our support system. You can view details about this issue here:<br /><br /><a href=\"{{url}}\">{{url}}</a>');
