\"right\" style=\"border-top: 0.5px solid black\">\n		</td>\n	</tr>\n\n	<tr>\n		<td colspan=\"2\" align=\"right\">\n			Totaal:\n		</td>\n		<td align=\"right\">\n			{{book.currency}} {{document.totalPrice|number}}\n		</td>\n	</tr>\n\n	[/if]\n\n    </tbody>\n\n</table>\n\n\n<br />\n\n\n<p>\n<div style=\"font-size: 120%; color: #2d4386\">Voorwaarden</div>\n[assign outstanding = {{document.totalPrice}} - {{document.paidAmount}}]\n\n\n[if {{document.subTotalPrice}} < 0]\n	[if {{outstanding}} < 0 ]\n		Wij betalen u het bedrag van <b>{{book.currency}} {{outstanding|number}}</b> binnen 14 dagen uit.\n	[else]\n		Alles is betaald.\n	[/if]\n[else]\n\n	[if {{outstanding}} > 0 ]\n		Gelieve het openstaande bedrag van <b>{{book.currency}} {{outstanding|number}}</b> binnen 14 dagen te betalen onder vermelding van het factuurnummer.\n	[else]\n		Bedankt voor uw betaling!\n	[/if]\n[/if]\n\n\n</p>','html'),
