[if {{document.showPricePerLine}}]\n                                <td align=\"right\" width=\"10%\">{{item.quantity|number}}</td>\n                                <td width=\"70%\">{{item.description|nl2br}}</td>\n                            [assign rowTotal = {{item.unitPrice}} * {{item.quantity}} ]\n                                <td align=\"right\" width=\"20%\">{{book.currency}} {{rowTotal|number}}</td>\n                            [else]\n                                <td colspan=\"3\">{{item.description|nl2br}}</td>\n                            [/if]\n                        </tr>\n                    [/if]\n				[/each]\n\n				[if {{itemGroup.showAs}} == \"groupwithtotal\"]\n					<tr>\n						<td colspan=\"2\" align=\"right\">\n							[if {{document.showPricePerLine}}]Totaal[else]Prijs[/if]:\n						</td>\n						<td align=\"right\">\n							{{book.currency}} {{itemGroup.subTotalPrice|number}}\n						</td>\n					</tr>\n				[/if]\n			[/if]\n		[/if]\n\n	[/each]\n\n\n	[if {{document.showTotals}}]\n\n\n	[if {{document.vatTotals|count}} > 0]\n	[if {{document.showPricePerLine}}]\n	<tr>\n		<td colspan=\"2\">\n		</td>\n		<td align=\"right\" style=\"border-top: 0.5px solid black\">\n		</td>\n	</tr>\n	[/if]\n	<tr>\n		<td colspan=\"2\" align=\"right\">\n			Subtotaal:\n		</td>\n		<td align=\"right\">\n			{{book.currency}} {{document.subTotalPrice|number}}\n		</td>\n	</tr>\n	[/if]\n\n\n	[if {{document.vatReverseCharge}}]\n		<tr>\n			<td colspan=\"2\" align=\"right\">\n				BTW verlegd (0%):\n			</td>\n			<td align=\"right\">\n				{{book.currency}} 0,00\n			</td>\n		</tr>\n	[else]\n		[each vatTotal in document.vatTotals]\n			<tr>\n				<td colspan=\"2\" align=\"right\">\n					BTW {{vatTotal.rate|number}}%:\n				</td>\n				<td align=\"right\">\n					{{book.currency}} {{vatTotal.price|number}}\n				</td>\n			</tr>\n		[/each]\n	[/if]\n\n	<tr>\n		<td colspan=\"2\">\n		</td>\n		<td align=\"right\" style=\"border-top: 0.5px solid black\">\n		</td>\n	</tr>\n\n	<tr>\n		<td colspan=\"2\" align=\"right\">\n			Totaal:\n		</td>\n		<td align=\"right\">\n			{{book.currency}} {{document.totalPrice|number}}\n		</td>\n	</tr>\n\n	[/if]\n\n    </tbody>\n\n</table>\n\n\n<br />\n\n\n<p>\n<div style=\"font-size: 120%; color: #2d4386\">Terms</div>\n[assign outstanding = {{document.totalPrice}} - {{document.paidAmount}}]\n\n\n[if {{outstanding}} > 0 ]\n	Please pay the outstanding amount of <b>{{book.currency}} {{outstanding|number}}</b> within 14 days. It\'s important that you mention your invoice number at your payment.\n[else]\n	Thank you for your payment!\n[/if]\n\n</p>','html'),
(11,11,NULL,NULL,NULL,NULL,'L','<table border=\"0\">\n	<tr>\n\n		<td width=\"60%\">\n			<div style=\"font-size: 200%; color: #2d4386\">\n				[if {{document.subTotalPrice}} > 0]\n				{{template.name}}\n				[else]\n				Credit note\n				[/if]\n			</div>\n			<br />\n		</td>\n		<td width=\"40%\">\n			[if {{logo}}]\n			<img src=\"{{logo}}\" />\n			[/if]\n		</td>\n	</tr>\n	<tr>\n\n		<td >\n\n			<small>To:</small>\n\n			<p>\n				{{document.customerTo}}<br />\n				{{document.formattedAddress|nl2br}}\n\n				[if {{customer.vatNo}}]\n				<br />\n				VAT no.: {{customer.vatNo}}\n				[/if]\n\n				<br /><br /><br />\n\n			</p>\n\n			<table>\n\n				<tr>\n					<td width=\"30%\"><b>Number:</b></td> <td>{{document.number}}</td>\n				</tr>\n\n				<tr>\n					<td><b>Date:</b></td> <td>{{document.date|date:d-m-Y}}</td>\n				</tr>\n\n				[if {{document.reference}}]\n				<tr><td><b>Reference:</b></td> <td>{{document.reference}}</td></tr>\n				[/if]\n\n			</table>\n\n\n		</td>\n\n\n		<td>\n\n			<small>Invoiced by:</small>\n\n			[assign businessOrg = business.contactId | entity:Contact]\n\n			<p>\n				{{businessOrg.name}}<br />\n				[assign bAddress = businessOrg.addresses | filter:type:\"postal\" | first]\n				[if !{{bAddress}}]\n				[assign bAddress = businessOrg.addresses | first]\n				[/if]\n				{{bAddress.formatted|nl2br}}\n\n				<br />\n\n				<br />\n			</p>\n\n			<table border=\"0\">\n\n				[assign orgEmail = businessOrg.emailAddresses | sort:type:\"work\" | first | prop:email]\n				[if {{orgEmail}}]\n				<tr><td width=\"20%\">e-mail:</td><td width=\"80%\"> {{orgEmail}}</td></tr>\n				[/if]\n\n				[assign orgNumber = businessOrg.phoneNumbers | sort:type:\"work\" | first | prop:number]\n				[if {{orgNumber}}]\n				<tr><td width=\"20%\">tel:</td><td width=\"80%\"> {{orgNumber}}</td></tr>\n				[/if]\n\n				<tr><td colspan=\"2\"><br /></td></tr>\n				<tr><td width=\"20%\">Bank:</td><td width=\"80%\"> {{businessOrg.nameBank}}</td></tr>\n				<tr><td>IBAN:</td><td> {{businessOrg.IBAN}}</td></tr>\n				<tr><td>BIC:</td><td> {{businessOrg.BIC}}</td></tr>\n\n				<tr><td colspan=\"2\"><br /></td></tr>\n				<tr><td>VAT no.:</td><td> {{businessOrg.vatNo}}</td></tr>\n				<tr><td>Company no.:</td><td> {{businessOrg.registrationNumber}}</td></tr>\n\n			</table>\n\n\n\n\n		</td>\n\n\n\n	</tr>\n</table>\n\n<br />\n<br />\n\n<table cellspacing=\"0\" cellpadding=\"4\">\n    <thead>\n	<tr style=\" background-color: #f1f1f1;\">\n		[if {{document.showPricePerLine}}]\n			<th style=\"border-bottom: 0.5px solid black;border-top: 0.5px solid black;\" width=\"10%\" align=\"right\">Quantity</th>\n			<th style=\"border-bottom: 0.5px solid black;border-top: 0.5px solid black;\" width=\"70%\">Description</th>\n		[else]\n			<th colspan=\"2\" style=\"border-bottom: 0.5px solid black;border-top: 0.5px solid black;\" width=\"80%\">Description</th>\n		[/if]\n		<th style=\"border-bottom: 0.5px solid black;border-top: 0.5px solid black;\" width=\"20%\" align=\"right\">[if {{document.showPricePerLine}}]Price[/if]</th>\n\n	</tr>\n    </thead>\n    <tbody>\n\n\n	[each itemGroup in document.itemGroups]\n\n		[if {{itemGroup.showAs}} != \"hidden\"]\n\n			[if {{itemGroup.showAs}} == \"single\"]\n				<tr>\n					[if {{document.showPricePerLine}}]\n						<td align=\"right\" width=\"10%\">1</td>\n						<td width=\"70%\">{{itemGroup.title}}</td>\n						<td align=\"right\" width=\"20%\">{{book.currency}} {{itemGroup.subTotalPrice|number}}</td>\n					[else]\n						<td colspan=\"3\">{{itemGroup.title}}</td>\n					[/if]\n				</tr>\n\n			[else]\n				[if {{itemGroup.title}}]\n					<tr><td colspan=\"3\" style=\"line-height: 200%;font-size:1.3em;font-weight:bold\">{{itemGroup.title}}</td></tr>\n				[/if]\n\n				[each item in itemGroup.items]\n                    [if {{item.description}} == \"__PAGEBREAK__\"]\n                        <br pagebreak=\"true\">\n                    [else]\n                        <tr nobr=\"true\">\n                            [if {{document.showPricePerLine}}]\n                                <td align=\"right\" width=\"10%\">{{item.quantity|number}}</td>\n                                <td width=\"70%\">{{item.description|nl2br}}</td>\n                                [assign rowTotal = {{item.unitPrice}} * {{item.quantity}} ]\n                                <td align=\"right\" width=\"20%\">{{book.currency}} {{rowTotal|number}}</td>\n                            [else]\n                                <td colspan=\"3\">{{item.description|nl2br}}</td>\n                            [/if]\n                        </tr>\n                    [/if]\n				[/each]\n\n				[if {{itemGroup.showAs}} == \"groupwithtotal\"]\n					<tr>\n						<td colspan=\"2\" align=\"right\">\n							[if {{document.showPricePerLine}}]Total[else]Price[/if]:\n						</td>\n						<td align=\"right\" style=\"border-top: 0.5px solid black\">\n							{{book.currency}} {{itemGroup.subTotalPrice|number}}\n						</td>\n					</tr>\n				[/if]\n			[/if]\n		[/if]\n\n	[/each]\n\n\n	[if {{document.showTotals}}]\n\n\n\n	[if {{document.vatTotals|count}} > 0]\n	[if {{document.showPricePerLine}}]\n		<tr>\n			<td colspan=\"2\">\n			</td>\n			<td align=\"right\">\n			</td>\n		</tr>\n	[/if]\n	<tr>\n		<td colspan=\"2\" align=\"right\">\n			Subtotal:\n		</td>\n		<td align=\"right\">\n			{{book.currency}} {{document.subTotalPrice|number}}\n		</td>\n	</tr>\n	[/if]\n\n\n	[if {{document.vatReverseCharge}}]\n		<tr>\n			<td colspan=\"2\" align=\"right\">\n				VAT Reverse charge (0%):\n			</td>\n			<td align=\"right\">\n				{{book.currency}} 0.00\n			</td>\n		</tr>\n	[else]\n		[each vatTotal in document.vatTotals]\n			<tr>\n				<td colspan=\"2\" align=\"right\">\n					VAT {{vatTotal.rate|number}}%:\n				</td>\n				<td align=\"right\">\n					{{book.currency}} {{vatTotal.price|number}}\n				</td>\n			</tr>\n		[/each]\n	[/if]\n\n	<tr>\n		<td colspan=\"2\">\n		</td>\n		<td align=\"right\" style=\"border-top: 0.5px solid black\">\n		</td>\n	</tr>\n\n	<tr>\n		<td colspan=\"2\" align=\"right\">\n			Total:\n		</td>\n		<td align=\"right\">\n			{{book.currency}} {{document.totalPrice|number}}\n		</td>\n	</tr>\n\n	[/if]\n    </tbody>\n\n</table>\n\n\n<br />\n\n\n<p>\n<div style=\"font-size: 120%; color: #2d4386\">Terms</div>\n[assign outstanding = {{document.totalPrice}} - {{document.paidAmount}}]\n\n[if {{document.subTotalPrice}} < 0]\n	[if {{outstanding}} < 0 ]\n		We will pay you the amount of <b>{{book.currency}} {{outstanding|number}}</b> within 14 days.\n	[else]\n		Everything is paid.\n	[/if]\n[else]\n\n	[if {{outstanding}} > 0 ]\n		Please pay the outstanding amount of <b>{{book.currency}} {{outstanding|number}}</b> within 14 days. It\'s important that you mention your invoice number at your payment.\n	[else]\n		Thank you for your payment!\n	[/if]\n[/if]\n</p>','html'),
