tr>\n				<tr><td>BIC:</td><td> {{businessOrg.BIC}}</td></tr>\n\n				<tr><td colspan=\"2\"><br /></td></tr>\n				<tr><td>VAT no.:</td><td> {{businessOrg.vatNo}}</td></tr>\n				<tr><td>Company no.:</td><td> {{businessOrg.registrationNumber}}</td></tr>\n\n			</table>\n\n\n\n\n		</td>\n\n\n\n	</tr>\n</table>\n\n<br />\n<br />\n\n<table cellspacing=\"0\" cellpadding=\"4\">\n    <thead>\n	<tr style=\" background-color: #f1f1f1;\">\n		[if {{document.showPricePerLine}}]\n			<th style=\"border-bottom: 0.5px solid black;border-top: 0.5px solid black;\" width=\"10%\" align=\"right\">Aantal</th>\n			<th style=\"border-bottom: 0.5px solid black;border-top: 0.5px solid black;\" width=\"70%\">Beschrijving</th>\n		[else]\n			<th colspan=\"2\" style=\"border-bottom: 0.5px solid black;border-top: 0.5px solid black;\" width=\"80%\">Beschrijving</th>\n		[/if]\n		<th style=\"border-bottom: 0.5px solid black;border-top: 0.5px solid black;\" width=\"20%\" align=\"right\">[if {{document.showPricePerLine}}]Prijs[/if]</th>\n\n	</tr>\n    </thead>\n    <tbody>\n\n	[each itemGroup in document.itemGroups]\n\n		[if {{itemGroup.showAs}} != \"hidden\"]\n\n			[if {{itemGroup.showAs}} == \"single\"]\n				<tr>\n					[if {{document.showPricePerLine}}]\n                        <td align=\"right\" width=\"10%\">1</td>\n                        <td width=\"70%\">{{itemGroup.title}}</td>\n                        <td align=\"right\" width=\"20%\">{{book.currency}} {{itemGroup.subTotalPrice|number}}</td>\n					[else]\n					    <td colspan=\"3\">{{itemGroup.title}}</td>\n					[/if]\n				</tr>\n\n			[else]\n				[if {{itemGroup.title}}]\n					<tr><td colspan=\"3\" style=\"line-height: 200%;font-size:1.3em;font-weight:bold\">{{itemGroup.title}}</td></tr>\n				[/if]\n\n				[each item in itemGroup.items]\n                    [if {{item.description}} == \"__PAGEBREAK__\"]\n                        <br pagebreak=\"true\">\n                    [else]\n                        <tr nobr=\"true\">\n                       